// src/components/HomePage.js
import React from 'react';
import { Container, Typography, Box } from '@mui/material';
import '../styles/HomePage.css';
import spaImage from '../images/spa.jpg';
import maniPediImage from '../images/manicure.jpg';
import waxingImage from '../images/waxing.jpg';

// const items = [
//   {
//     name: "Spa",
//     description: "Relax and rejuvenate with our spa treatments.",
//     image: spaImage
//   },
//   {
//     name: "Mani/Pedi",
//     description: "Perfect nails with our mani/pedi services.",
//     image: maniPediImage
//   },
//   {
//     name: "Waxing",
//     description: "Smooth and silky skin with our waxing services.",
//     image: waxingImage
//   }
// ];
const HomePage = () => {
    return (
      <Container className="container">
        <section className="hero-section">
          <p className="hero-text">
            Nothing improves your mood like a new manicure.
          </p>
        </section>
        <Box mt={4}>
          <Typography variant="h5" mt={2}>
          </Typography>
        </Box>

        {/* New Image Grid Section */}
        <section className="image-grid-section">
          <div className="grid-item">
            <img src="../images/spa.jpg" alt="Spa" />
            <Typography variant="h6" className="grid-text">Spa</Typography>
          </div>
          <div className="grid-item">
            <img src="../images/manicure.jpg" alt="Mani/Pedi" />
            <Typography variant="h6" className="grid-text">Mani/Pedi</Typography>
          </div>
          <div className="grid-item">
            <img src="path_to_waxing_image.jpg" alt="Waxing" />
            <Typography variant="h6" className="grid-text">Waxing</Typography>
          </div>
        </section>
      </Container>
    );
  };

  export default HomePage;
